import React, { useState, useEffect } from 'react'
import { Row, Col, Carousel, ListGroup, Tab, Sonnet } from 'react-bootstrap'
import Product from '../components/Product'
import Loader from '../components/Loader'
import Message from '../components/Message'
import { useDispatch, useSelector } from 'react-redux'
import { listProducts } from '../actions/productActions'

function HomeScreen() {
    // const [products, setProducts] = useState([])

    const dispatch = useDispatch()
    const productList = useSelector(state => state.productList)
    const {error, loading, products, p} = productList

    useEffect(() => {
        dispatch(listProducts())

    //     async function fetchProducts() {
    //         const { data } = await axios.get('/api/products/')
    //         setProducts(data)
    //     }

    //     fetchProducts()

    }, [dispatch])

    return (
        <div>
            <Row>
            <Col md={3}>
            <Tab.Container id="list-group-tabs-example" defaultActiveKey="#link1">
  <Row>
    <Col sm={4}>
      <ListGroup>
        <ListGroup.Item action href="#link1">
          Link 1
        </ListGroup.Item>
        <ListGroup.Item action href="#link2">
          Link 2
        </ListGroup.Item>
      </ListGroup>
    </Col>
    <Col sm={8}>
      <Tab.Content>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link2">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link3">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
        <Tab.Pane eventKey="#link1">
          {/* <Sonnet /> */}
        </Tab.Pane>
      </Tab.Content>
    </Col>
  </Row>
</Tab.Container>
            </Col>

            <Col md={9}>
                <img src='https://newbikeadmin.dwmaster-bikes.co.uk/uploads/offers/image/Suzuki/suzuki-v-strom-650-500-offer-hero.png'
                width="950"
                height="370"></img>
            </Col>
            </Row>
            <br />
            <h1>Recent Products</h1>
            <hr />
            <br />

            {loading ? <Loader />
                : error ? <Message variant='danger'>{error}</Message>
                    :
                    <Row>
                        {products.map(product => (
                            <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                                <Product product={product} />
                            </Col>
                        ))}
                    </Row>   
                }
                {/* <Row>
              
                     <h1>Motorbike</h1>
                    
                     {products.map(product => (
                            <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                                <Product product={product} />
                            </Col>
                        ))}
                </Row> */}
            
        </div>
    )
}

export default HomeScreen
